def is_null_or_empty(val):
    # None, empty string (or whitespace-only), or empty list/tuple/set
    return (
        val is None
        or (isinstance(val, str)    and not val.strip())
        or (isinstance(val, (list, tuple, set)) and len(val) == 0)
    )

